#
# Structure for table "fanwe_msg_broadcast"
#

DROP TABLE IF EXISTS `fanwe_msg_broadcast`;
CREATE TABLE `fanwe_msg_broadcast` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `content` text NOT NULL COMMENT '内容',
  `pusher` varchar(16) NOT NULL COMMENT '消息发送者',
  `create_time` int(11) NOT NULL COMMENT '推送时间',
  `is_read` tinyint(1) NOT NULL COMMENT '是否已推送 0:未推送 1:已推送',
  `is_delete` tinyint(1) NOT NULL COMMENT '是否被用户删除',
  `type` tinyint(1) NOT NULL COMMENT '消息接口类型:ios/android/ios_android等，实现来源于接口调用',
  `ios_data` text NOT NULL COMMENT '消息相关数据集，序列化后用于接口调用',
  `end_time` int(11) NOT NULL COMMENT '过期时间',
  `android_data` text NOT NULL,
  `push_type` tinyint(1) NOT NULL COMMENT '消息推送类型:1.单播 2.列播  3.组播 4.广播 5.文件播',
  `alias_type` varchar(10) NOT NULL COMMENT '当type=customizedcast时，必填，alias的类型',
  `alias` varchar(100) NOT NULL COMMENT '要求不超过50个alias,多个alias以英文逗号间隔。',
  `filter` text NOT NULL COMMENT '终端用户筛选条件,如用户标签、地域、应用版本以及渠道等',
  `ios_device_tokens` text NOT NULL COMMENT 'ios设备唯一标识',
  `android_device_tokens` text NOT NULL COMMENT 'android设备唯一标识',
  `go_url` text NOT NULL COMMENT '点击通知跳转url',
  PRIMARY KEY (`id`),
  KEY `user_id` (`pusher`),
  KEY `is_read` (`is_read`),
  KEY `is_delete` (`is_delete`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='app推送消息';

