INSERT INTO `fanwe_web_article` VALUES (1,'了解一元夺宝','<div>一元夺宝”指用户花费1元兑换一个夺宝币，用户可凭夺宝币使用一元夺宝的服务。</div>\n<div><br />\n</div>\n<div>每件商品的全部夺宝号码分配完毕后，一元夺宝根据夺宝规则计算出的一个号码。持有该幸运号码的用户可直接获得该商品。</div>\n',1,1464114056,1464114056,0,1,'',0,0,0,1,'','','','',0,'',''),(2,'一元夺宝平台服务协议','<span style=\"color:#909090;font-family:\'microsoft yahei\', simhei, sans-serif;font-size:14px;line-height:23.324px;\">欢迎访问一元疯投平台，申请使用公司提供的一元疯投平台服务（以下简称“一元夺宝”，“一元夺宝”指用户花费1元兑换一个夺宝币，用户可凭夺宝币使用一元夺宝的服务），请您（下列简称为“用户”）仔细阅读以下全部内容（特别是粗体下划线标注的内容）。如用户不同意本服务条款任意内容，请勿注册或使用一元疯投。</span>',1,1464114077,1493077495,0,1,'',0,0,0,2,'','','','',0,'',''),(3,'常见问题','<p><span style=\"line-height:1.5;\">1、充值获得夺宝币，然后选择喜欢的商品开始夺宝；</span></p>\n<p><span style=\"line-height:1.5;\"><br />\n</span></p>\n<div>2、点击一个感兴趣的商品，选择要参与的人次并支付，直接充值并参与夺宝。</div>\n<div><br />\n</div>\n<div>1元夺宝，就是这么简单！</div>\n<div>2、1元夺宝是怎么计算幸运号码的？</div>\n<div>1）商品的最后一个号码分配完毕后，将公示该分配时间点前本站全部商品的最后50个参与时间；</div>\n<div>2）将这50个时间的数值进行求和（得出数值A）（每个时间按时、分、秒、毫秒的顺序组合，如20:15:25.362则为201525362）；</div>\n<div>3）为保证公平公正公开，系统还会等待一小段时间，取最近下一期中国福利彩票“老时时彩”的开奖结果（一个五位数值B）；</div>\n<div>4）（数值A+数值B）除以该商品总需人次得到的余数 + 原始数 10000001，得到最终幸运号码，拥有该幸运号码者，直接获得该商品。</div>\n<div>注：如遇福彩中心通讯故障，无法获取上述期数的中国福利彩票“老时时彩”开奖结果，且24小时内该期“老时时彩”开奖结果仍未公布，则默认“老时时彩”开奖结果为111111。</div>\n<div>了解更多“老时时彩”信息</div>\n<div><br />\n</div>\n<div>3、为什么要加入“老时时彩”开奖结果？</div>\n<div>引入“老时时彩”开奖结果是为了保证幸运号码计算结果的绝对公平公正。</div>\n<div><br />\n</div>\n<div>4、幸运号码的计算结果可信吗？</div>\n<div>由于使用了“老时时彩”开奖结果作为参数，因此幸运号码肯定是未知的；</div>\n<div>您可以绝对相信计算结果真实、可信。</div>\n<div><br />\n</div>\n<div>5、怎样查看是否中奖？</div>\n<div>个人中心有您的夺宝记录，点击对应的记录，即可知道该期夺宝的获得者</div>\n',1,1464114108,1464114108,0,1,'',0,0,0,0,'','','','',0,'',''),(4,'公平保障','一元夺宝作为一个平台，保证所有参与夺宝的用户行为，都享受同样的权利与义务。',2,1464114144,1464114144,0,1,'',0,0,0,3,'','','','',0,'',''),(5,'公正保障','一元夺宝作为一个平台，保证所有参与夺宝的用户行为，都享受同样的权利与义务。',2,1464114167,1464114167,0,1,'',0,0,0,4,'','','','',0,'',''),(6,'商品配送','<p>在您获奖后，一元夺宝会第一时间为您寄出商品，大陆地区免快递费。</p>\n<p>获得商品后，请您尽快提交收货地址，超过7天未确认收货地址，视为自动放弃该商品。</p>\n',3,1464114180,1464114180,0,1,'',0,0,0,5,'','','','',0,'',''),(7,'配送费用','所有商品大陆地区免费快递。',3,1464114193,1464114193,0,1,'',0,0,0,6,'','','','',0,'','');
